import React, { Component } from 'react';
import './App.css';
import Header from '../src/components/header/Header.js';

class App extends Component {
  render() {
    return (
      <div className="app">
        <Header />
        <h2>ONLINE YOGA CLASSES</h2>
      </div>
    );
  }
}

export default App;
